import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { QrReader } from 'react-qr-reader';
import './Portfolios.css';

const Portfolios = () => {
  const navigate = useNavigate();
  const [scanning, setScanning] = useState(false);
  const [result, setResult] = useState('');

  const handlePortfolioClick = () => {
    navigate('/Portfolioslist');
  };

  const handleScan = (data) => {
    if (data) {
      setResult(data);
      setScanning(false);
      // You can add additional logic here to handle the scanned data
    }
  };

  const handleError = (err) => {
    console.error(err);
  };

  const startScanning = () => {
    setScanning(true);
  };

  return (
    <div className="main_menu_wrapper container">
      <div className="text-center mb-4">
        <h5 className="black-text">ARJUN'S PORTFOLIOS</h5>
      </div>
      <div className="portfoilios">
        <div className="text-center mt-4">
          {scanning ? (
            <QrReader
              delay={300}
              onError={handleError}
              onScan={handleScan}
              style={{ width: '100%' }}
            />
          ) : (
            <div className="qr-code-box p-3 mb-4" onClick={startScanning}>
              <div>
                <img src="/scanner.png" alt="Scan QR Code" className="img-fluid" />
              </div>
              <div className="text-center">
                <h3>Scan QR Code</h3>
              </div>
            </div>
          )}
          {result && (
            <div className="text-center mt-3">
              <p>Scanned Result: {result}</p>
            </div>
          )}
        </div>
        <div className="row">
          <div className="col-6 col-md-3 mb-4">
            <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
              <div>
                <img src="/home.svg" alt="Portfolio 1" className="img-fluid mb-2" />
              </div>
              <div className="mt-2">
                <h4>Portfolio 1</h4>
              </div>
              <div className="mt-2">
                <small>6 items</small>
              </div>
            </div>
          </div>
          <div className="col-6 col-md-3 mb-4">
            <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
              <div>
                <img src="/home.svg" alt="Portfolio 2" className="img-fluid mb-2" />
              </div>
              <div className="mt-2">
                <h4>Portfolio 2</h4>
              </div>
              <div className="mt-2">
                <small>2 items</small>
              </div>
            </div>
          </div>
          <div className="col-6 col-md-3 mb-4">
            <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
              <div>
                <img src="/home.svg" alt="Portfolio 3" className="img-fluid mb-2" />
              </div>
              <div className="mt-2">
                <h4>Portfolio 3</h4>
              </div>
              <div className="mt-2">
                <small>3 items</small>
              </div>
            </div>
          </div>
          <div className="col-6 col-md-3 mb-4">
            <div className="shadow portfolio-box p-3" onClick={handlePortfolioClick}>
              <div>
                <img src="/home.svg" alt="Portfolio 4" className="img-fluid mb-2" />
              </div>
              <div className="mt-2">
                <h4>Portfolio 4</h4>
              </div>
              <div className="mt-2">
                <small>9 items</small>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Portfolios;
